DocumentBuilder archiveCreator = Util.getDocumentBuilder(archiveCreatorFactory);
if (setting.containsKey("validate")) {
    archiveCreatorFactory.setValidating((boolean) setting.get("validate"));
}
if (setting.containsKey("schema")) {
    SchemaFactory schemaFactory = SchemaFactory.newInstance(XMLConstants.W3C_XML_SCHEMA_NS_URI);
    schemaFactory.setResourceResolver(new ResourceResolver());
    Schema schema = schemaFactory.newSchema((Source) setting.get("schema"));
    archiveCreatorFactory.setSchema(schema);
}

