DocumentBuilder documentBuilder = Util.getDocumentBuilder(documentBuilderFactory);
if (config.containsKey("validate")) {
    documentBuilderFactory.setValidating((boolean) config.get("validate"));
}
if (config.containsKey("schema")) {
    SchemaFactory schemaFactory = SchemaFactory.newInstance(XMLConstants.W3C_XML_SCHEMA_NS_URI);
    schemaFactory.setResourceResolver(new ResourceResolver());
    Schema schema = schemaFactory.newSchema((Source) config.get("schema"));
    documentBuilderFactory.setSchema(schema);
}
